import React from "react";

function ToDoList(props) {
  return (
    <ul>
      {props.todos.map((todo) => (
        <li key={todo} onClick={props.handleDelete}>
          {todo}
        </li>
      ))}
    </ul>
  );
}

export default ToDoList;
